import { observer } from "mobx-react";
import React from "react";
import { StyleSheet, Text, View } from "react-native";
import authStore from "../../store/authStore";
import profileStore from "../../store/profileStore";
import SearchBar from "./SearchBar";

const ProfileList = () => {
  const profileList =profileStore.profiles.map((profile) => (
    <profileItem profile={profile} key={profile._id} />
  ));

  return (
    <View>
        <SearchBar/>
        <Text>checking</Text>
      <Text>{profileList}</Text>
    </View>
  );
};

updateTrip = async (updatedProduct, productId) => {
  try {
    const res = await instance.put(`/products/${productId}`, updatedProduct);
    this.products = this.products.map((product) =>
      product._id === productId ? res.data : product
    );
  } catch (error) {
    console.log("ProductStore -> updateProduct -> error", error);
  }
};


export default observer(ProfileList);

const styles = StyleSheet.create({});
